import './Testimonial.css'

import { Container } from "react-bootstrap";

function Testimonial(){
    return(
        <div className='testimonial'>
            <Container fluid>
                <div>
                    <h3 className = "testimonial__title">Our Testimonials</h3>
                    <div class = "line"></div>
                </div>
            </Container>
        </div>
    )
}

export default Testimonial
